  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is a georeferenced version
  of an original black and white aerial photograph downloaded from Earth Explorer
  (USGS; www.earthexplorer.usgs.gov). The original photo (Frame 88) was georeferenced
  against the 2009 NAIP image within ArcMap 10.1. Six to eight points were used in
  the georeferencing process. This data set provides a look back in time following
  the closure of the Flaming Gorge Dam. It allows a look at landscape features including
  riparian vegetation extent, existing farmland, shrublands, etc. It also provides
  an important look at the location of the Green River channel to interpret river
  dynamics and movement. Pixel resolution of this image is 0.6 meters. This image
  should be used for resource level interpretation only.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
